import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

function Footer() {
    return (
    <footer className="">
      <div>

      </div>
      <div>
          <p className="text-red-100">Follow us on social networks:</p>
          <ul className="flex">
              <li className="text-red-100"><a href="https://www.linkedin.com/in/ruthmatieu/" target="_blank">LinkedIn</a></li>
              <li className="text-red-100"><a href="https://twitter.com/ruthmatieu" target="_blank">Twitter</a></li>
              <li className="text-red-100"><a href="http://instagram.com/civil_co" target="_blank">Instagram</a></li>
              <li className="text-red-100"><a href="https://www.facebook.com/profile.php?id=100008826826867" target="_blank">Facebook</a></li>
              <li><i className="fab fa-linkedin-in text-red-900"></i></li>
          </ul>
      </div>
    </footer>
    )
}

export default Footer;
